import React from 'react';
import logo from '../../assets/logo.png';
import style from './Header.module.css';
import logoSpectre from './Logo/logo';

const header = () => {
    return (        
      <div className={style.Header}>
        <logoSpectre/>
      </div>
    );
}

export default header;
